import React from 'react';

const EmojiImage = ({ emojis }) => {
	const fontSize = window.innerWidth / emojis[0].length;
	return (
		<div>
			{emojis.map((row, index) => {
				return (
					<div key={index} style={{ margin: 0, padding: 0, height: { fontSize } }}>
						{row.map((emoji, index) => {
							return (
								<p key={index} style={{ display: 'inline-block', margin: 0, padding: 0, fontSize: { fontSize }, widht: '1ch' }}>
									{emoji}
								</p>
							);
						})}
					</div>
				);
			})}
		</div>
	);
};

export default EmojiImage;
